import React from 'react'
import { MDBInputGroup, MDBAutocomplete, MDBIcon, MDBBtn } from 'mdb-react-ui-kit';


function SearchComponent()
{

    return (

    <div className='entire-component' style={{display:"flex"}}>
    <div className="container mt-5">
      <h1 className='text-center'>Search for Stocks</h1>
      <div className="row mt-5">
        <div className="col-md-6 offset-md-3">
          <div className="input-group mb-3">
            <input type="text" className="form-control" placeholder="Enter a search query" />
            <div className="input-group-append">
              <button className="btn btn-primary" type="button">Search</button>
            </div>
          </div>
        </div>
      </div>
    </div>

    <MDBInputGroup>
      <MDBAutocomplete
        label='Example label'
        dataFilter={(value: any) => {
          return data.filter((item) => {
            return item.toLowerCase().startsWith(value.toLowerCase());
          });
        }}
      />
      <MDBBtn rippleColor='dark'>
        <MDBIcon icon='search' />
      </MDBBtn>
    </MDBInputGroup>
    </div>

    );


}


export default SearchComponent;
